import React, { Component } from "react";
import banner from "../header.jpg";

export default class Landing extends Component {
  render() {
    return (
      <div className="header">
        <img src={banner} className="landing_image" alt="" />
        <div className="bar">
          <h1 className="header_name">Cesar Ferreyra-Mansilla</h1>

          <div className="introduction">
            <p>Hey, my name is Cesar. Im a web developer.</p>
          </div>
        </div>
      </div>
    );
  }
}
